import React from "react";
import Logo from "../components/Logo";
import Navigation from "../components/Navigation";

const News = () => {
  return (
    <div>
      <Navigation />
      <Logo />
      <div className="news-container">
        <h1>News</h1>
      </div>
    </div>
  );
};

export default News;
